article_content:
문짝이 다소 어긋나거나 상판에 이어붙인 흔적이 있는 정도의 흠이 있지만, 문짝 여닫는 데 문제없고 상판이야 그 부분을 밑에 두고 이용하면 되니 사용하는 데는 아무 불편함 없습니다. 이 가격이기에 이해할 수 있는 흠이라고 생각합니다. 상판은 시트지의 질감인데, 저는 위에 도마를 두고 물을 자주 묻힐 거라서 비닐시트지를 따로 붙였습니다. 170cm인 저에게는 조금 낮아서 허리가 아프지만, 이 정도 높이일 줄 알고 구매한 거니까요, 뭐... 전체적으로 만족합니다. 택배사는 바꾸셨으면 합니다만 저렴한 택배비를 유지하려면 별수없으려나 싶습니다.(...)


*****추가*****
이사가려고 사이즈 새로 재는데 이거 가로 80이 아니라 90센티였음;; 상세내용 사이즈랑 다른것같네요. 참고하세요;
